mple and straightforward products that can be used often.” \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple – and that’s the point. “We’ve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way.” We can’t solve the entire food waste problem – but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ round-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Height: 8 cm \r\n</p><p>Diameter: 14 cm \r\n</p><p>Volume: 600 ml \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Length：8 Cm \r\n</p><p>Diameter：14 Cm \r\n</p><p>Weight：0.43 Kg \r\n</p><p>Number of packages： 1 \r\n</p><p>Designer’s concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. It’s very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven – or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 1080.00, NULL, 0, '[]', '[]', '[]', NULL, 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, 1, 0.00, 'amount', 1632767400, 1703788140, NULL, NULL, 'flat_rate', '300', 1, 3, 1, 'IKEA 365+ Food Container. Round. Glass. 600 ml', 'IKEA 365+ Food Container. Round. Glass. 600 ml \r\nStore/Home &amp; Lifestyles/IKEA Collections \r\nIKEA 365+ Food Container. Round. Glass. 600 ml \r\nSKU IKEA-103.591.97 \r\nProduct Details \r\nBrand: IKEA \r\nWeight: 0.46 kg \r\nProduct description \r\nHelps you take care of food – and the planet \r\nIf you want to reduce food waste but sometimes think it’s a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples’ needs, we visited families in several countries. We found out that it’s all about versatility and simplicity. \r\nYou’ve just put leftovers after eating into a food container, but can’t find a lid that fits. Or maybe you’ve put a food container in the fridge with food in it, but you can’t see what’s inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. “We wanted to develop products to make this easier,” says David \r\nGranath, a product developer who has worked with the project. “They should be simple and flexible. \r\nAnd easy to combine and use in ways that suit every household.” \r\nNo extra work \r\n“It can involve things like using the same food container for several steps and just changing the lid. There shouldn’t be any unnecessary extra work along the way,” says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. “People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often.” \r\nSmart and super simple \r\nThe IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple – and that’s the point. “We’ve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way.” We can’t solve the entire food waste problem – but we can make it possible for everyone to be part of the solution. \r\nThe food container is made of oven-safe glass and can be used as an oven/serving dish. \r\nMade of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\nThe transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\nPlease refer to packaging label for country of origin Fits with IKEA 365+ round-shaped lids. \r\nWash this product before using it for the first time. \r\nDesigner \r\nSarah Fager \r\nProduct dimensions \r\nHeight: 8 cm \r\nDiameter: 14 cm \r\nVolume: 600 ml \r\nCare instructions Microwave-safe. \r\nFreezer-safe. \r\nDishwasher-safe. \r\nOven-safe \r\nEnvironment and materials \r\nEnvironment \r\nNo cadmium or lead added. \r\nMaterials \r\nHeat resistant glass \r\nPackaging info \r\nIKEA 365+ \r\nFood container \r\nLength：8 Cm \r\nDiameter：14 Cm \r\nWeight：0.43 Kg \r\nNumber of packages： 1 \r\nDesigner’s concept \r\nBorosilicate glass can handle conditions that are a bit too tough for ordinary household glass. It’s very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven – or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass.', '514', NULL, 'ikea-365-food-container-round-glass-600-ml-1ngsq', 0.00, NULL, 0, 0, NULL, NULL, '2021-09-28 09:23:00', '2021-10-02 03:46:46'),
(122, 'IKEA FÖRVAR Glass Jar with Lid. 1.8 ltr', 'admin', 9, 40, NULL, '527,519', '513', 'youtube', NULL, 'ikea,glass,jar,container,food,kitchen', '<h4><b><font color=\"#ff0000\">IKEA FÖRVAR Glass Jar with Lid. 1.8 ltr \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>Creative Design Body or Bottom Standing Glass Jar for Convenient Storage Use. \r\n</p><p>SKU IKEA-502.024.87 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.84 kg \r\n</p><p>Product description \r\n</p><p>The contents are easy to reach as the opening is on the front. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>You can reduce your food waste by storing your dry foods in a jar with a tight-fitting lid, because it keeps the food fresh longer. \r\n</p><p>Please refer to packaging label for country of origin \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Carl Öjerstam \r\n</p><p>Product dimensions \r\n</p><p>Height: 18 cm \r\n</p><p>Volume: 1.8 l \r\n</p><p>Care instructions \r\n</p><p>Dishwasher-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>The material in this product may be recyclable. Please check the recycling rules in your community and if recycling facilities exist in your area. \r\n</p><p>Materials \r\n</p><p>Jar :Glass \r\n</p><p>Lid: Polypropylene plastic \r\n</p><p>Packaging info \r\n</p><p>FÖRVAR \r\n</p><p>Jar with lid \r\n</p><p>Width：17 Cm \r\n</p><p>Height：13 Cm \r\n</p><p>Length：18 Cm \r\n</p><p>Weight：0.84 Kg \r\n</p><p>Number of packages： 1 \r\n</p><p>Designer’s concept \r\n</p><p>Glass doesn’t absorb food flavours, colours or odours. For instance, you can use the same glass jar first for onions then for raspberries, and the raspberries won’t taste of onion. As long as you wash the jar between foods. And unlike plastic, glass doesn’t stain. Not even from tomato sauce or blueberrie