(16, 17, 'Superior premium quality with respect to workmanship and performance. 6 levels of protection include over heat, over load, over charge, surge,  Output: 5V/2.4A, 5V/1.0A', '1', '<h4 style=\"text-align: center; \"><b>Superior premium quality with respect to workmanship and performance.</b></h4><p style=\"text-align: center; \"><br></p><p>Superior premium quality with respect to workmanship and performance. 6 levels of protection include over heat, over load, over charge, surge, regulator and short circuit. Lightweight and compact design for maximum portability. Cable jacket: PVC, with spring For charging of smart phones, camera, Tablet, MP3-player and similar devices. DUDAO Global warranty Brand: DUDAO&nbsp; Model: A2UK T&nbsp; Type: Wall charger with Type C cable&nbsp; Input voltage: 100-240V AC/50-60Hz&nbsp; Output: 5V/2.4A, 5V/1.0A<br></p>', 'en', '2021-03-16 08:57:42', '2021-03-16 08:57:42'),
(17, 18, 'Portable Bluetooth Speaker Outdoor Rechargeable Wireless Speaker Sound Bar, Built-in TF, FM Radio Subwoofer Speaker', '1', '<h4 style=\"text-align: center;\">Portable Bluetooth Speaker Outdoor Rechargeable Wireless Speaker Sound Bar, Built-in TF, FM Radio Subwoofer Speaker</h4><ul class=\"\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; overflow: hidden; columns: auto 2; column-gap: 32px; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px;\"><li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.67d978b8qLjKUV\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid; column-span: all;\"><b>Product Details of Portable Bluetooth Speaker Outdoor Rechargeable Wireless Speaker Sound Bar, Built-in TF, FM Radio Subwoofer Speaker TG117Description1. Battery type: 1200mah lithium-ion polymer playback time is 4-6 hours (depending on volume and content)2. Portable design with hanging rod, very suitable for outdoor, indoor, travel and carrying3. The FM support function of this speaker can listen to the broadcast.4. Compatible with Micro SD card, can plug-in USB hard disk to play MP3 music.5. Using Aux cable, this speaker can be connected to the TV, computer, laptop, tablet, etc. through a 3.5mm audio port.6. Built-in smart energy-saving system, if disconnected in Bluetooth mode, the Bluetooth speaker will automatically turn off7. Hands-free call with microphone</b></li></ul>', 'en', '2021-03-16 09:02:45', '2021-03-16 09:02:45'),
(18, 19, 'Digital Led Alarm Clocks Student Clocks With Week Snooze Thermometer Watch Electronic L Desk Timer Table Calendar', '1', '<p style=\"text-align: center; \"><b>Digital Led Alarm Clocks Student Clocks With Week Snooze Thermometer Watch Electronic L Desk Timer Table Calendar&nbsp;</b></p><p style=\"text-align: center; \"><br></p><ul class=\"\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; overflow: hidden; columns: auto 2; column-gap: 32px; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px;\"><li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.1086c85fR1Np28\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Digital Table Clocks LED Alarm Clock Student Clock With Week Snooze Thermometer Electronic Calendar L Display Desk Clock Timer</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">1. Normal time mode: The product displays the time, date(2000 to 2099), week, and temperature. And it can switch between 12/24 hours display.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">2.Alarm and snooze mode: Daily alarm time can be set; up to 8 well-known-globally melodies can be selected as alarm sound, and at the same time the snooze function can be started.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">3.World time mode: world time and local time can be displayed together. And it can set the time of 16 metropolises as local time.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">4.Timer mode: Countdown can be set up with a range of 23:59:59-0:00:00, When it arrives at the set time, the product will alarm.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Colour: Black</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Material: ABS</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">5.Thermometer: The product can automatically measure and display the temperature of current surroundings with a range of 0 °C-50°C(or 32℉-122℉).Under the normal status, press the\" ▼°C/℉\" key to switch between Centigrade or Fahrenheit display.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">6. Multi-language function: The product can display week in 7 different languages(English, Dutch, Portuguese, Spanish, Italian, German, French), to make it more convenient for a larger number of users around the world. 7.Sound control lighting function: Press the \" LIGHT \" key and the light can be started or closed. The light can be also started by the sound of a gentle hit on the table or a clap within the range of 1 meter or by touching any place on the product, in the convenience of reading the time at night, The light will automatically go off in 5 seconds.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Package included:</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">1* Clock</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">1* User Manual</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Only the above package content, other products are not included.</li><li class=\"\" style=\"margin: 0px; padding: 0px 0px 0px 15px; position: relative; font-size: 14px; line-height: 18px; text-align: left; list-style: none; word-break: break-word; break-inside: avoid;\">Note: Light and different displays may cause the color of the item in the picture a little different from the real thing. The measurement allowed error is +/- 1-3cm.</li></ul><p style=\"text-align: center; \"><br></p><div style=\"text-align: left;\"></div>', 'en', '2021-03-16 09:07:24', '2021-03-16 09:07:24'),
