(100, 104, '2005-BKU Calidad alternative for HP 05A (CB505A), 80A (CF280A) Universal', '1', '<h5><b style=\"\"><font color=\"#ff0000\">2005-BKU Calidad alternative for<br>\r\nHP 05A (CB505A), 80A (CF280A) Universal</font></b></h5><h5><b style=\"color: rgb(0, 0, 255); font-size: 1.25rem;\">HP</b><br></h5><div><font color=\"#0000ff\"><b>LaserJet P2035\r\n</b></font></div><div><font color=\"#0000ff\"><b>LaserJet M4353\r\n</b></font></div><div><font color=\"#0000ff\"><b>LaserJet P2055\r\n</b></font></div><div><font color=\"#0000ff\"><b>LaserJet Pro 400 M401\r\n</b></font></div><div><font color=\"#0000ff\"><b>LaserJet Pro 400 M425\r\n</b></font></div><div><font color=\"#0000ff\"><b>LaserJet Pro MFP M425</b></font></div><h5><br></h5><h5>Colour:\r\n</h5><div>Volume:\r\n</div><div>BK\r\n</div><div>2300 Page Yield\r\n</div><div>*HP and HP printer models are registered trademarks of Hewlett Packard Co. Calidad has no affiliation with HP.</div><div><br></div><div>Australia’s only specialist Ink cartridge manufacturer\r\n</div><div>100% Australian Owned Company\r\n</div><div>Visit our website : www.calidad.com.au\r\n</div><div>\r\n</div><div><br></div><div>Laser Toner Cartridges\r\n</div><div>Calidad Laser Toner Cartridges offer savings of up to 50% compared to the cost of an original cartridge whilst delivering a printing solution you can rely on every time. Calidad has over 45 years experience in the manufacturing of alternative printing consumables.\r\n</div><div>Calidad is the manufacturer of high quality Inkjet and Laser Toner Cartridges for many Primary Printer Brands\r\n</div><div>.\r\n</div><div>At Calidad we are proud that our high quality, competitive products dominate a national market unlike any other compatible brand worldwide.\r\n</div><div>The strength of our manufacturing process is that the Calidad Product Development Team works with the engineers in the factories of our manufacturing partners. Both in the factories every month and daily online.\r\n</div><div>Fast to market with new model cartridges so as not to miss out on the OEMs short product life cycle.</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div>', 'en', '2021-09-09 12:06:45', '2021-09-09 12:06:45'),
