(115, 119, 'Thermal Insulated Food Containers. 1.0', '1', '<h4><b><font color=\"#ff0000\">Thermal Insulated Food Containers. 1.0 \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/Dineware \r\n</p><p>Double Layer Stainless Steel Thermo Insulated Vacuum and Leakproof Food Storage Warmer. \r\n</p><p>SKU YA-INSULTDFOODCONT-M1-1L \r\n</p><p>Storage Capacity \r\n</p><p>1 Ltr \r\n</p><p>Product Details \r\n</p><p>Weight: 0.85 kg \r\n</p><p>Stainless Steel Thermo Insulated Vacuum Food Storage Container. Double Layer Thermal Insulation. Bento Round Leakproof Food Warmer. \r\n</p><p>Features:</p><p> \r\n</p><p>Stainless Steel Double Layer Round Bento Thermos Food Storage Container to keep the food warm and hot \r\n</p><p>Comes with additional storage tray inside \r\n</p><p>Keep overnight dinner and Have late lunch \r\n</p><p>Food-grade stainless steel, strong and durable \r\n</p><p>Ideal for using in home, office, school or outdoor activities \r\n</p><p>Easy to clean, not easy to stick dirt, convenient to carry \r\n</p><p>Color: Silver (as shown in the pictures) \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:11:05', '2021-09-28 09:11:05'),
(116, 120, 'IKEA 365+ Food Container. Rectangular. Glass. 1 ltr', '1', '<h4><font color=\"#ff0000\"><b>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>IKEA 365+ Food Container. Rectangular. Glass. 1 ltr \r\n</p><p>SKU IKEA-103.592.01 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.68 kg \r\n</p><p>Product description \r\n</p><p>Helps you take care of food – and the planet \r\n</p><p>If you want to reduce food waste but sometimes think it’s a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples’ needs, we visited families in several countries. We found out that it’s all about versatility and simplicity. \r\n</p><p>You’ve just put leftovers after eating into a food container, but can’t find a lid that fits. Or maybe you’ve put a food container in the fridge with food in it, but you can’t see what’s inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. “We wanted to develop products to make this easier,” says David \r\n</p><p>Granath, a product developer who has worked with the project. “They should be simple and flexible. \r\n</p><p>And easy to combine and use in ways that suit every household.” \r\n</p><p>No extra work \r\n</p><p>“It can involve things like using the same food container for several steps and just changing the lid. There shouldn’t be any unnecessary extra work along the way,” says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. “People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often.” \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple – and that’s the point. “We’ve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way.” We can’t solve the entire food waste problem – but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ rectangular-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Length: 21 cm \r\n</p><p>Width: 15 cm \r\n</p><p>Height: 6 cm \r\n</p><p>Volume: 1.0 l \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>By creating products that help people minimize waste, we contribute to enabling a more sustainable life at home. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Width：15 Cm \r\n</p><p>Height：6 Cm \r\n</p><p>Length：21 Cm \r\n</p><p>Weight：0.68 Kg \r\n</p><p>Number of packages： 1 \r\n</p><p>Designer’s concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. It’s very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven – or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:17:31', '2021-09-28 09:17:31'),
(117, 121, 'IKEA 365+ Food Container. Round. Glass. 600 ml', '1', '<h4><font color=\"#ff0000\"><b>IKEA 365+ Food Container. Round. Glass. 600 ml \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>IKEA 365+ Food Container. Round. Glass. 600 ml \r\n</p><p>SKU IKEA-103.591.97 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.46 kg \r\n</p><p>Product description \r\n</p><p>Helps you take care of food – and the planet \r\n</p><p>If you want to reduce food waste but sometimes think it’s a bit of a pain to take care of your food, this might help. IKEA 365+ food storage products make it easier to store, save and bring food with you on the go. To get to know more about peoples’ needs, we visited families in several countries. We found out that it’s all about versatility and simplicity. \r\n</p><p>You’ve just put leftovers after eating into a food container, but can’t find a lid that fits. Or maybe you’ve put a food container in the fridge with food in it, but you can’t see what’s inside the food container and completely forget about the food. These were things we heard time and time again when interviewing families about their experiences. “We wanted to develop products to make this easier,” says David \r\n</p><p>Granath, a product developer who has worked with the project. “They should be simple and flexible. \r\n</p><p>And easy to combine and use in ways that suit every household.” \r\n</p><p>No extra work \r\n</p><p>“It can involve things like using the same food container for several steps and just changing the lid. There shouldn’t be any unnecessary extra work along the way,” says David. Transparent containers increase the chances that the food is consumed. And it must be easy to adapt the containers to serve different needs. “People asked for a coherent system for food storage. Not complicated special gadgets, yet rather simple and straightforward products that can be used often.” \r\n</p><p>Smart and super simple \r\n</p><p>The IKEA 365+ food containers and lids can be combined and also come in different materials and sizes. They are super simple – and that’s the point. “We’ve put a lot of work into them, for example by seeing to it that all the different parts fit together. But the product itself is simple in a smart way.” We can’t solve the entire food waste problem – but we can make it possible for everyone to be part of the solution. \r\n</p><p>The food container is made of oven-safe glass and can be used as an oven/serving dish. \r\n</p><p>Made of glass, which does not absorb odours or discolour from tomato sauce, etc, so the food container is easy to clean. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>Please refer to packaging label for country of origin Fits with IKEA 365+ round-shaped lids. \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Sarah Fager \r\n</p><p>Product dimensions \r\n</p><p>Height: 8 cm \r\n</p><p>Diameter: 14 cm \r\n</p><p>Volume: 600 ml \r\n</p><p>Care instructions Microwave-safe. \r\n</p><p>Freezer-safe. \r\n</p><p>Dishwasher-safe. \r\n</p><p>Oven-safe \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>No cadmium or lead added. \r\n</p><p>Materials \r\n</p><p>Heat resistant glass \r\n</p><p>Packaging info \r\n</p><p>IKEA 365+ \r\n</p><p>Food container \r\n</p><p>Length：8 Cm \r\n</p><p>Diameter：14 Cm \r\n</p><p>Weight：0.43 Kg \r\n</p><p>Number of packages： 1 \r\n</p><p>Designer’s concept \r\n</p><p>Borosilicate glass can handle conditions that are a bit too tough for ordinary household glass. It’s very impact and scratch resistant and withstands rapid temperature changes, allowing you to take it directly from the freezer to the oven – or vice versa. And if it somehow breaks, it shatters into large pieces with less risk of someone getting hurt. Simply a tougher type of glass. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:23:00', '2021-09-28 09:23:00'),
(118, 122, 'IKEA FÖRVAR Glass Jar with Lid. 1.8 ltr', '1', '<h4><b><font color=\"#ff0000\">IKEA FÖRVAR Glass Jar with Lid. 1.8 ltr \r\n</font></b></h4><p>Store/Home &amp; Lifestyles/IKEA Collections \r\n</p><p>Creative Design Body or Bottom Standing Glass Jar for Convenient Storage Use. \r\n</p><p>SKU IKEA-502.024.87 \r\n</p><p>Product Details \r\n</p><p>Brand: IKEA \r\n</p><p>Weight: 0.84 kg \r\n</p><p>Product description \r\n</p><p>The contents are easy to reach as the opening is on the front. \r\n</p><p>The transparent jar makes it easy to find what you are looking for, regardless of where it is placed. \r\n</p><p>You can reduce your food waste by storing your dry foods in a jar with a tight-fitting lid, because it keeps the food fresh longer. \r\n</p><p>Please refer to packaging label for country of origin \r\n</p><p>Wash this product before using it for the first time. \r\n</p><p>Designer \r\n</p><p>Carl Öjerstam \r\n</p><p>Product dimensions \r\n</p><p>Height: 18 cm \r\n</p><p>Volume: 1.8 l \r\n</p><p>Care instructions \r\n</p><p>Dishwasher-safe. \r\n</p><p>Environment and materials \r\n</p><p>Environment \r\n</p><p>The material in this product may be recyclable. Please check the recycling rules in your community and if recycling facilities exist in your area. \r\n</p><p>Materials \r\n</p><p>Jar :Glass \r\n</p><p>Lid: Polypropylene plastic \r\n</p><p>Packaging info \r\n</p><p>FÖRVAR \r\n</p><p>Jar with lid \r\n</p><p>Width：17 Cm \r\n</p><p>Height：13 Cm \r\n</p><p>Length：18 Cm \r\n</p><p>Weight：0.84 Kg \r\n</p><p>Number of packages： 1 \r\n</p><p>Designer’s concept \r\n</p><p>Glass doesn’t absorb food flavours, colours or odours. For instance, you can use the same glass jar first for onions then for raspberries, and the raspberries won’t taste of onion. As long as you wash the jar between foods. And unlike plastic, glass doesn’t stain. Not even from tomato sauce or blueberries. That’s what you call a clear advantage. \r\n</p><p><br></p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p><p> \r\n</p>', 'en', '2021-09-28 09:28:02', '2021-09-28 09:28:02'),
(119, 123, 'Oil Frying Strainer Clip Clamp Spoon', '1', '<h4><font color=\"#ff0000\"><b>Oil Frying Strainer Clip Clamp Spoon \r\n</b></font></h4><p>Store/Home &amp; Lifestyles/Kitchen \r\n</p><p>SKU YA-OILSTRAINSPOON-1CV179 \r\n</p><p>Product Details \r\n</p><p>Weight: 0.25 kg \r\n</p><p>Strainer Clip Stainless Steel Oil-frying Clamp Spoon. Fried Food Cooking Tools Kitchen Gadgets. M/NO: 1CV179 \r\n</p><p><br></p><p> \r\n</p>', 'en', '2021-09-28 09:32:24', '2021-09-28 09:32:24'),
(120, 124, 'Nike unisex  casual sports Running Shoes - Multi color', 'pair', NULL, 'en', '2021-09-29 07:52:42', '2021-09-29 07:52:42'),
(121, 125, '50ml Hand Sanitizer Flip Top Cap', '1', '<h4><b><font color=\"#295218\">50ml Flip Top Cap</font></b></h4><p>• 75% Alcohol (WHO recommended alcohol content)<br></p><p>• No residual activity\r\n</p><p>• No bleach\r\n</p><p>• Anti-bacterial, Anti- Fungal, Antiviral\r\n</p><p>• Moisturizes your hands\r\n</p><p>• Approved by Health Ministry &amp; NMRA\r\n</p><p>• Highly endorsed &amp; recommended by medical professionals</p><p>MediSafe is the product of years of research and development by MW Lifesciences. MediSafe is a premium alcohol-based hand sanitizer. MediSafe hand disinfectant is a complete bactericidal, viricidal, and fungicidal alcohol-based hand-rub disinfectant manufactured in accordance with USP formula and WHO guidelines.\r\n</p><p>Composition:\r\n</p><p>Isopropyl Alcohol – 75% (v/v)\r\n</p><p>Hydrogen Peroxide – 0.125% (v/v)\r\n</p><p>Glycerine BP – 1.45% (v/v)\r\n</p><p>Aqua QS</p><p><b><font color=\"#ff0000\">DIRECTIONS TO USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 2×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 6×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-29 12:02:06', '2021-09-30 07:29:15'),
