(143, 149, '100ml Hand Sanitizer Gel - Cool Water', '1', '<h4><b><font color=\"#295218\">100ml Hand Sanitizer Gel - Cool Water</font></b></h4><p>• 75% Alcohol (WHO recommended alcohol content)<br></p><p>• No residual activity\r\n</p><p>• No bleach\r\n</p><p>• Anti-bacterial, Anti- Fungal, Antiviral\r\n</p><p>• Moisturizes your hands\r\n</p><p>• Approved by Health Ministry &amp; NMRA\r\n</p><p>• Highly endorsed &amp; recommended by medical professionals</p><p>MediSafe is the product of years of research and development by MW Lifesciences. MediSafe is a premium alcohol-based hand sanitizer. MediSafe hand disinfectant is a complete bactericidal, viricidal, and fungicidal alcohol-based hand-rub disinfectant manufactured in accordance with USP formula and WHO guidelines.\r\n</p><p>Composition:\r\n</p><p>Isopropyl Alcohol – 75% (v/v)\r\n</p><p>Hydrogen Peroxide – 0.125% (v/v)\r\n</p><p>Glycerine BP – 1.45% (v/v)\r\n</p><p>Aqua QS</p><p><b><font color=\"#ff0000\">DIRECTIONS TO USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 2×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 6×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:13:23', '2021-09-30 11:13:23'),
(144, 150, '1L Multi-Surface Disinfectant + Trigger Pump', '1', '<h4><b><font color=\"#295218\">1L Multi-Surface Disinfectant + Trigger Pump</font></b></h4><p>• Alcohol-based surface disinfectant\r\n</p><p>• Batericidal, fungicidal, and viricidal action.\r\n</p><p>• Manufactured in accordance with WHO recommended guidelines</p><p>MediSafe Multi-Surface Disinfectant is an alcohol-based surface disinfectant with powerful bactericidal, fungicidal, and viricidal action. Manufactured in accordance with WHO recommended guidelines.\r\n</p><p>\r\n</p><p>Composition:<br></p><p>Alcohol – 75% (v/v)</p><p><br></p><p><b><font color=\"#ff0000\">DIRECTIONS FOR USE :</font></b></p><p>\r\n</p><p>Aqua QSSpray MediSafe Surface Disinfectant directly to the surface and leave for 5-10 sec. Wipe with a clean cloth thereafter. Can be used on plastic, wooded, glass, etc. surfaces. Safe to use on food contact surfaces without rinse.</p><p><br></p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:27:42', '2021-09-30 11:27:42'),
(145, 151, '5L Multi Surface Disinfectant  Can', '1', '<h4><b><font color=\"#295218\">5L Multi-Surface Disinfectant Can</font></b></h4><p>• Alcohol-based surface disinfectant\r\n</p><p>• Batericidal, fungicidal, and viricidal action.\r\n</p><p>• Manufactured in accordance with WHO recommended guidelines</p><p>MediSafe Multi-Surface Disinfectant is an alcohol-based surface disinfectant with powerful bactericidal, fungicidal, and viricidal action. Manufactured in accordance with WHO recommended guidelines.\r\n</p><p>\r\n</p><p>Composition:<br></p><p>Alcohol – 75% (v/v)</p><p><br></p><p><b><font color=\"#ff0000\">DIRECTIONS FOR USE :</font></b></p><p>\r\n</p><p>Aqua QSSpray MediSafe Surface Disinfectant directly to the surface and leave for 5-10 sec. Wipe with a clean cloth thereafter. Can be used on plastic, wooded, glass, etc. surfaces. Safe to use on food contact surfaces without rinse.</p><p><br></p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:33:23', '2021-09-30 11:33:23'),
(146, 152, '1% Sodium Hypochlorite – 5L Can', '1', '<h4><b><font color=\"#295218\">1% Sodium Hypochlorite – 5L Can</font></b></h4><p>• 1% Sodium Hypochlorite\r\n</p><p>• Anti-microbial Bleach Disinfectant\r\n</p><p>• Industrial grade bleach to sanitize and clean</p><p>Ideal for commercial kitchens, garbage bins, brightening fabrics in the wash, and fresher, cleaner bathrooms. Removes stubborn stains and mildew around shower screens and basins. Removes built-up dirt on grouting between tiles. Maintaining cleanliness around refrigerators, stoves, dishwashers, and benchtops. Sterilizes and clean china, plasticware, mops, squeegees, etc.\r\n</p><p>Composition:\r\n</p><p>Sodium Hypochlorite 1% (v/v) in Aqueous base Q.S</p><p><b><font color=\"#ff0000\">DIRECTIONS FOR USE :</font></b></p><p>• Store below 30° C.\r\n</p><p>• Avoid direct contact with sunlight.\r\n</p><p>• Do not expose to excessive heat or flames.\r\n</p><p>• Highly flammable</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:39:34', '2021-09-30 11:39:34'),
(147, 153, '500ml Anti-Microbial Hand Wash', '1', '<h4><font color=\"#295218\"><b>500ml Anti-Microbial Hand Wash</b></font></h4><p>• Bactericidal, Viricidal &amp; Fungicidal\r\n</p><p>• Non-Alcohol / No Bleach Disinfectant\r\n</p><p>• Can be used in Food Manufacturing places\r\n</p><p>• Suitable for countertops, tabletops &amp; chairs\r\n</p><p>• No bleach\r\n</p><p>• Non-Flammable</p><p>MediSafe is the product of years of research and development by MW Lifesciences. Anti-Microbial Hand Wash is a complete bactericidal, viricidal, and fungicidal Hand Wash Soap.\r\n</p><p>\r\n</p><p><b style=\"\">Composition:</b><br></p><p><b style=\"\">Sodium Laureth Sulphate</b></p><p><b style=\"\">\r\n</b></p><p><b style=\"\">EDTA\r\n</b></p><p><b style=\"\">Lauramin Oxide\r\n</b></p><p><b style=\"\">Sodium Benzoate\r\n</b></p><p><b style=\"\">Sodium Chloride</b></p><p><b><font color=\"#ff0000\">DIRECTIONS TO USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 2×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 6×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:55:10', '2021-09-30 11:55:10'),
(148, 154, '5L Anti-Microbial Hand Wash', '1', '<h4><font color=\"#295218\"><b>5L Anti-Microbial Hand Wash</b></font></h4><p>• Bactericidal, Viricidal &amp; Fungicidal\r\n</p><p>• Non-Alcohol / No Bleach Disinfectant\r\n</p><p>• Can be used in Food Manufacturing places\r\n</p><p>• Suitable for countertops, tabletops &amp; chairs\r\n</p><p>• No bleach\r\n</p><p>• Non-Flammable</p><p>MediSafe is the product of years of research and development by MW Lifesciences. Anti-Microbial Hand Wash is a complete bactericidal, viricidal, and fungicidal Hand Wash Soap.\r\n</p><p>\r\n</p><p><b style=\"\">Composition:</b><br></p><p><b style=\"\">Sodium Laureth Sulphate</b></p><p><b style=\"\">\r\n</b></p><p><b style=\"\">EDTA\r\n</b></p><p><b style=\"\">Lauramin Oxide\r\n</b></p><p><b style=\"\">Sodium Benzoate\r\n</b></p><p><b style=\"\">Sodium Chloride</b></p><p><b><font color=\"#ff0000\">DIRECTIONS TO USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 2×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 6×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 11:59:43', '2021-09-30 11:59:43'),
(149, 155, '1% BKC Solution Surface Sanitizer - 5L', '1', '<h4><font color=\"#295218\"><b>1% BKC Solution Surface Sanitizer - 5L</b></font></h4><p>• Bactericidal, Viricidal &amp; Fungicidal\r\n</p><p>• Non-Alcohol / No Bleach Disinfectant\r\n</p><p>• Can be used in Food Manufacturing places\r\n</p><p>• Suitable for countertops, tabletops, chairs, etc.\r\n</p><p>• No bleach\r\n</p><p>• Non-Flammable</p><p>Effective disinfectant to all types of surfaces. Does not contain any alcohol or bleach. Not a corrosive chemical that will have any long-term damage or impact on any surface.\r\n</p><p>Composition:\r\n</p><p>Benzalkonium Chloride\r\n</p><p>Sodium Lauryl Sulphate\r\n</p><p>EDTA\r\n</p><p>Aqua QS</p><p><b><font color=\"#ff0000\">DIRECTIONS FOR USE :</font></b></p><p>Hygenic Hand Disinfection:\r\n</p><p>Rub Medisafe (3ml) 2×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds.\r\n</p><p>Surgical Hand Disinfection: \r\n</p><p>Rub Medisafe (9ml) 6×1.5ml pushes from the calibrated pump, Thoroughly clean area of hands, nail grooves for 30 seconds</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-09-30 12:05:46', '2021-09-30 12:05:46'),
(150, 156, 'Siddharaja Hair Oil 100ml', '1', '<h3><img src=\"https://shopiya.lk/public/uploads/all/GBo9p3UqJHngRaqDC0cPghVoomUC120vGkm6BjqX.png\" style=\"width: 676.997px;\"><br></h3><h5><b><font color=\"#6ba54a\"><br></font></b></h5><h5><b><font color=\"#6ba54a\">SIDDHA RAJA GOLDEN GIRL EXTRA PREMIUM HAIR OIL\r\n</font></b></h5><p>Siddha Raja Golden Extra Premium Hair Growing Oil is made with unifying the\r\n</p><p>Vitamin A, B1, C, B12 essences in Gotukola Leaves, Vitamin B, E, Cammestarol\r\n</p><p>essences in Mukunuwenna Leaves/ Moisture, Protein, Vitamin E, K essences in\r\n</p><p>Karanda Leaves / Vitamin D, B12, Sodium, Potassium, Calcium in Olive Oil /\r\n</p><p>Vitamin E, Phosphorus, Omega 9 in Armand / Vitamin D, Vitamin B 12, A and\r\n</p><p>essence of Iron in Coconut Oils /Omega essence in Kekerindiya, is specifically\r\n</p><p>made by following old listings to rehabilitate the bunches of hair damaged due to\r\n</p><p>hair dressing materials such as firming, coloring, and re-bonding.\r\n</p><p>It will give your bunch of hair with full scope and thickness by re-fostering by\r\n</p><p>seizing the breaking, falling , bursting, leaning of hair by 100% within a week. It\r\n</p><p>will prevent dandruff. It will prevent disorders in the scull. Will nourish the nerves.\r\n</p><p>It will give full scoped bunch of hair to those who have less hairs by growing hair.\r\n</p><p>The essences of oils of Kanranda, Kekirindiya, Olive will delay the graying of hair.\r\n</p><p>As the Siddha Raja Golden Extra Premium Hair Growing Oil is made in accordance\r\n</p><p>with the ancestral special listing targeted as special hair treatment material, it is\r\n</p><p>sufficient to apply and then allow it to be on the hair only for 60 minutes if per day\r\n</p><p>full day also make no issues . As required with all the other hair oils, it need not be\r\n</p><p>apply and allowed to be on the head for few hours.\r\n</p><p>Apply few drops of Siddha Raja Golden Extra Premium Hair Growing Oil on the\r\n</p><p>head and massage well and then wash away after 60 minutes. For best results use it\r\n</p><p>in the morning. Application on few days in a week is sufficient. Can achieve 100%\r\n</p><p>results within a month.\r\n</p><h5><b><font color=\"#6ba54a\" style=\"\">சித்த ராஜ க ால்டன் க ர்ல் எ ்ஸ் ட்ரா ப்ரிமியம்<br>\r\n</font><font color=\"#6ba54a\" style=\"\">க ஷ வர்தன ததலம்\r\n</font></b></h5><p>விட்டமின் A, B1, C, B12 அடங்கிய வல்லாதரச்சாறும், விட்டமின் B, E அடங்கிய\r\n</p><p>பபான்னாங் னி சாறும், ப ம்பமஸ் டகரால் சாறும், ரந்த\r\n</p><p>இதலயின் ஈரமூட்டி, புரதம், விட்டமின் E, K\r\n</p><p>என் பனவும், ஒலிவ் எண் பணய்யில் அடங்கியுள்ள விட்டமின் D, B12,\r\n</p><p>கசாடியம், பபாட்டாசியம், ல்சியம் என் பனவும், பாதாமிலுள்ள விட்டமின்\r\n</p><p>E, பபாஸ் பரசு, ஒகம ா 9 கதங் ாய் எண் பணய்யின் விட்டமின் D, B12, A,\r\n</p><p>இரும்புச் சத்து, கீகிரிதியவிலுள்ள ஒகம ா சாறும் நீ ர்த்து\r\n</p><p>தயாரி ் ப்பட்டுள்ள சித்த ராஜ க ால்டன் க ர்ல் எ ்ஸ் ட்ரா ப்ரிமியம்\r\n</p><p>க ஷ வர்தன ததலம், கபர்மிங், நிறமூட்டல், ரீபபாண் டிங் உட்பட ச ல\r\n</p><p>கூந்தல் அலங் ார கவதல ளினாலும் கசதமுற்ற மயிரிதை தள\r\n</p><p>மீண் டும் நல்ல நிதல ்கு ப ாண் டு வருவதற் ா விகஷடமா\r\n</p><p>தயாரி ் ப்பட்டதாகும்.\r\n</p><p>மயிர் உதடதல், ப ாட்டுதல், பவடித்தல், பமலிவதடதல்\r\n</p><p>கபான் றனவற்தற 100% தடுத்து, ஒரு வாரத்து ்குள் உங் ள் க ஷத்து ்கு\r\n</p><p>கபாஷதன ஊட்டி மீண் டும் பசழுதமயதடயச் பசய்து, அடர்த்தியான\r\n</p><p>கூந்ததல வைங்குகின் றது. ததல நரம்பு ளு ்கு கபாஷா ்கூட்டி மயிர் ள்\r\n</p><p>அடர்த்தி குதறவா உள்ள இடங் ளில் மயிர் வளர்ச்சிதயத்\r\n</p><p>தூண் டுகின் றது. ரந்த, கீகிரிய, ஒலிவ் ஆகியவற்றின் சாறினால் ததல\r\n</p><p>மயிர்பவண் தம அதடவது தாமதப்படுத்தப்படுகின் றது.\r\n</p><p>சித்த ராஜ க ால்டன் க ர்ல் எ ்ஸ் ட்ரா ப்ரிமியம் க ஷ வர்தன ததலம்,\r\n</p><p>பாரம்பரிய அதி விகஷட மூலித பட்கடாதலதய ்\r\n</p><p>ப ாண் டு விகஷடமான கூந்தல் பரி ாரமா தயாரி ் ப்பட்டுள்ளதனால்,\r\n</p><p>ஒரு நாதள ்கு 30 நிமிட கநரம் ததலயில் கதய்ப்பது\r\n</p><p>கபாதுமானதாகும். ஏதனய கூந்தல் எண் பணய் தளப் கபான்று\r\n</p><p>மணித்தியால ் ண ் ா பூச கவண் டிதில்தல.\r\n</p><p>சித்த ராஜ க ால்டன் க ர்ல் எ ்ஸ் ட்ரா ப்ரிமியம் க ஷ வர்தன ததல சில\r\n</p><p>துளி தள ததலயில்பூசி நன் றா கதய்த்து, 30 நிமிடங் ளின் பிறகு ழுவி\r\n</p><p>விடவும். ாதலயில் கதய்ப்பது அதி பலன் தர ் கூடியதுடன், நல்ல\r\n</p><p>குணமும்தரும். வாரத்தில்சில நாட் ள்உபகயாகிப்பதுகபாதுமானதாகும்.</p><p>ஒரு மாதத்து ்குள் 100% பலன் பபறலாம்.</p><p><img src=\"https://shopiya.lk/public/uploads/all/gIVYok3GuA3jJa67mt4jrkWquuft6iuRRNhJtfVU.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/jRTFbccofbbL41WVuzH0Ny3dohFnyG3lTpPJUUt1.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/1LALDBp3GmO3LI4HHQbOkMJ0c5lhSq117ToFdLHE.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/9JlOlgC2MR9XTGPTjEKBXkEv0HLRPpGDWdIzSZhd.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/0U3IvnH3LupwAio900hxr97dJsl9Z0lCFK4lk25q.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/VW0OH9Tr9WUWXDJe1astXChV6gFae13GeSXweA21.jpg\" style=\"width: 472.778px;\"><img src=\"https://shopiya.lk/public/uploads/all/EJDWg6Rt0dcYpkKFIBLqFbCjzvB46VYeDmlOHsJc.jpg\" style=\"width: 472.778px;\"><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-10-01 04:27:09', '2021-10-01 07:00:51'),
